</head><body><h1>INES Mapper 133</h1><div class="article">
<p>GoodNES allocated <strong class="selflink">iNES Mapper 133</strong> for the <a class="extiw" href="http://www.wikia.com/wiki/c:bootleggames:Sachen" title="wikia:c:bootleggames:Sachen">Sachen</a> unlicensed game &quot;Jovial Race&quot;. It's almost identical to <a href="NINA_003_006.xhtml" title="NINA-003-006">NINA-06</a>.
</p><p>Санчез, however, allocated Jovial Race to <a href="INES_Mapper_150.xhtml" title="INES Mapper 150">iNES Mapper 150</a>. Either way, its UNIF MAPR is <b>UNL-SA-72008</b>.
</p>
<pre> Mask: $6100
 Bus conflicts for the mirror at $C100-$DFFF (don't do that)
 $4100: [.... .PCC] - Select 32 KiB PRG bank and 8 KiB CHR bank
</pre>
